import React from "react";
import { Navigate} from "react-router-dom";
import { Route, Routes } from 'react-router-dom';
import AddTabel from "./admindashboard/AddTabel";
import NavAdmin from "./halamanadmin/NavAdmin";
import { ProSidebarProvider } from 'react-pro-sidebar';
import Tabeladmin from "./admindashboard/Tabelkegiatan";
import EditTabel from "./admindashboard/EditTabel";

const Admin = () => {
    const tkn = localStorage.getItem('tkn')
    
    
    if(!tkn){
        return <Navigate to ="/login" />
    }

    return(
        <div>
            <ProSidebarProvider> 
            <NavAdmin>
              <Route path='/dashboard' element={<Admin/>}/>
              <Route path='/dashboard/tabelkegiatan' element={<Tabeladmin />}/>
              <Route path='/dashboard/add' element={<AddTabel/>}/>
              <Route path='/dashboard/edit/:id' element={<EditTabel/>}/>
            </NavAdmin>
          </ProSidebarProvider>
        </div>
    );
}

export default Admin;
